import { NewServiceButton } from "../components/newServiceButton/NewServiceButton"

export const HomePage = () => {


    return (

        <main>
            <h1>List Services</h1>

            <input type="text" placeholder="Search a service"></input>
            <button>Search</button>

            <NewServiceButton />
            <HomePageCards />

        </main>

    )


}
